module("video",{
  setup: function() {
    //Create the video element
    var source = $("<source />").attr({
        src: "media/lego.mp4"
      , type: "video/mp4"
      })
    , video = $("<video />").attr({
        id: "demo_video"
      , class: "video-js vjs-default-skin"
      , controls: "controls"
      , preload: "auto"
      }).append(source) //Append source to video element
    /*
    * We have to wait for
    * 1. Video.js to load
    * 2. The video metadata to load
    */
    , waitForThings = 2
    , checkIfReady = function() {
        waitForThings--;
        
        if(waitForThings<=0) {
          start();
        }
      };
    
    //Stop test runner
    stop();
    
    //Bind to the metadata loaded event
    video.bind("loadedmetadata",function(e) {
      e.preventDefault();
      e.stopPropagation();
      
      ok(true, "Metadata loaded");
      ok(this.videoWidth, "Width is valid");
      ok(this.videoHeight, "Height is valid");
      checkIfReady();
    });
    
    //Add the video
    $("#qunit-fixture").append(video);
    
    //Init with video.js
    _V_("demo_video", {}, function(){
      ok(true, "Video.js loaded");
      checkIfReady();
    });
  }
});

test("test screenshot",function() {
  expect(5);
  var video = $("#demo_video").find("video")[0]
    , player = _V_("demo_video")
    , thumber = new jsthumb()
    , opts = {
        origWidth: player.width()
      , origHeight: player.height()
      }
    , base64Data = thumber.screenshot(video, opts);
  
  //TODO: Figure out a way to calculate similarity between images as every captured image is slightly different...
  ok(base64Data,"Screenshot was taken")
});

module("image",{
  setup: function() {
    //Create the image element
    var image = $("<image />").attr({
        id: "demo_image"
      , src: "media/globe.jpg"
      })
    /*
    * We have to wait for
    * 1. The image to load
    */
    , waitForThings = 1
    , checkIfReady = function() {
        waitForThings--;
        
        if(waitForThings<=0) {
          start();
        }
      };
    
    //Stop test runner
    stop();
    
    //Bind to the image loaded event
    image.bind("load",function(e) {
      e.preventDefault();
      e.stopPropagation();
      
      ok(true, "Image loaded");
      checkIfReady();
    });
    
    //Add the image
    $("#qunit-fixture").append(image);
  }
});

test("test resize", 2, function() {
  var image = $("#demo_image")[0]
    , thumber = new jsthumb()
    , opts = {
        maxWidth: 640
      , maxHeight: 468
      }
    , base64Data = thumber.resize(image, opts);
    
    ok(base64Data,"Screenshot was taken")
});

